import React from "react";
import { StatusBar } from "expo-status-bar";
import {
	StyleSheet,
	Text,
	View,
	Image,
	SafeAreaView,
	TouchableOpacity,
} from "react-native";

import GlobalTitles from "../components/global-titles";
import SearchBar from "../components/searchbar";
import GenreMenu from "../components/genre-menu";

export default function Lists() {
	return (
		<SafeAreaView style={styles.container}>
			<View style={styles.marginContainer}>
				<View style={styles.listSelectorContainer}>
					<View style={styles.listSelector}>
						<TouchableOpacity style={styles.selectorElement}>
							<Text>Saved</Text>
						</TouchableOpacity>
						<TouchableOpacity>
							<Text>Completed</Text>
						</TouchableOpacity>
					</View>
				</View>
			</View>
		</SafeAreaView>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
	},
	marginContainer: {
		marginHorizontal: "3%",
	},
	listSelectorContainer: {
		marginTop: "13%",
		justifyContent: "center",
		alignItems: "center",
		borderRadius: 20,
		backgroundColor: "green",
	},
	listSelector: {
		flexDirection: "row",
		justifyContent: "center",
		alignItems: "center",
		borderRadius: 20,
		backgroundColor: "blue",
		paddingHorizontal: 10,
	},
	selectorElement: {
		padding: 10,
		width: "25%",
		justifyContent: "center",
		alignItems: "center",
		backgroundColor: "red",
		fontSize: 20,
	},
});
